const michellePic = "michelle-obama.jpg";
const corgiPic = "./corgi.jpg";
const barackPic = "./barack-obama.jpg";

const contacts = [
  {
    user_id: 1,
    name: "Michelle Obama",
    pic: michellePic,
    status: "First Lady",
  },
  {
    user_id: 2,
    name: "Barack Obama",
    pic: barackPic,
    status: "US President",
  },
  {
    user_id: 3,
    name: "Corgi",
    pic: corgiPic,
    status: "First Lady",
  },
];
export default contacts;
